import React, { Component } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogTitle from '@material-ui/core/DialogTitle';
import InputLabel from '@material-ui/core/InputLabel';
import Input from '@material-ui/core/Input';
import MenuItem from '@material-ui/core/MenuItem';
import Select from '@material-ui/core/Select';
import FormLabel from '@material-ui/core/FormLabel';
import FormControl from '@material-ui/core/FormControl';
import FormGroup from '@material-ui/core/FormGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import FormHelperText from '@material-ui/core/FormHelperText';
import Checkbox from '@material-ui/core/Checkbox';

/*
const useStyles = makeStyles(theme => ({
  container: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  formControl: {

    margin: theme.spacing(1),
    minWidth: 120,
  },
}));
*/
class Dialog2 extends Component{
  constructor(props) {
    super(props);
    this.state = {
      open: false,
      gilad: true,
      jason: false,
      antoine: false,
    };
  }

  handleChange = (event) => {
    const target = event.target;
    const name = target.name;
    this.setState({  [name]: event.target.checked });
 }

  handleClickOpen = () =>{
    this.setState({ open: true });
  }

  handleClose =  () =>{
    this.setState({  open: false });
  }

  render = () => {
      return (
    <div>
      <Button variant="contained" color="primary"  onClick={this.handleClickOpen}>Update Charts</Button>
      <Dialog disableBackdropClick disableEscapeKeyDown open={this.state.open} onClose={this.handleClose}>
        <DialogTitle>Choose categories to generate charts.</DialogTitle>
        <DialogContent>
          <form>
          <FormControl component="fieldset">

      <FormGroup>
        <FormControlLabel
          control={<Checkbox checked={true} onChange={this.handleChange('gilad')} value={this.state.columns} />}
          label="Gilad Gray"
        />
        <FormControlLabel
          control={<Checkbox checked={false} onChange={this.handleChange('jason')} value="jason" />}
          label="Jason Killian"
        />
        <FormControlLabel
          control={
            <Checkbox checked={false} onChange={this.handleChange('antoine')} value="antoine" />
          }
          label="Antoine Llorca"
        />
      </FormGroup>
    </FormControl>

          </form>
        </DialogContent>
        <DialogActions>
          <Button onClick={this.handleClose} color="primary">
            Cancel
          </Button>
          <Button onClick={this.handleClose} color="primary">
            Ok
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
  }
}


export default Dialog2;
